const FiberArchitecture = () => {
  const childString = "<Child/>";
  return (
    <div>
      <h2>Fiber Architecture:</h2>

      <h1 className="parent">
        <Child />
      </h1>

      {console.log("Child Fiber", (<Child />)._owner)}
      {/* {console.log("Parent of Child Fiber", (<Child />)._owner.return)} */}
      {/* <Test /> */}
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
