        className="card"
      >
        <div style={{ paddingRight: "1rem" }}>
          <p>{childString} fiber object:</p>
          <p>Parent of {childString} fiber:</p>
          <p>{childString} render return value:</p>
          <p>Child fiber: </p>
        </div>

        <div>
          <p>{childString}._owner</p>
          <p>{childString}._owner.return</p>
          <p>{childString}._owner.child</p>
          <p>
            {childString}._owner.(memoizedProps|pendingProps)[3].props.children
          </p>
        </div>
      </div>
    </div>
  );
};

export default FiberArchitecture;
